import { all } from 'redux-saga/effects';
import { watcherGetNotesSaga, watcherGetNoteByIdSaga, watcherDeleteNoteByIdSaga } from './notesSagas';

export default function* rootSaga() {
  yield all([watcherGetNotesSaga(), watcherGetNoteByIdSaga(), watcherDeleteNoteByIdSaga()]);
}
